import Card from "./Card"
import Data from "./Data"

function Courses(){
    const Maping=Data.map((Card1)=>{
       return(
        <Card Card1={Card1}/>
)

    })
return(
<div className="Courses p-4 h-100 mt-4" style={{backgroundColor:"#f1f5f9"}}>
    <h3 className="Addres fs-2">Courses</h3>
    <div>
    {Maping}
    </div>
</div>        
)
}
export default Courses
